import React from "react";
import { Link } from "react-router-dom";
import "./Landing.module.css";

const Landing = () => {
    return (
      <div className="landing-container">
        <h1 className="landing-title">Bienvenidos a mi Portfolio</h1>
        <p className="landing-description">
          Aquí encontrarás gran parte de mis trabajos como FullStack Developer.
        </p>
        <Link to="/home#home" className="landing-button">
          Aplicar
        </Link>
      </div>
    );
  };
  
  export default Landing;
